css:
.github-Accordion {
  cursor: default;
  user-select: none;
}
.github-Accordion-header {
  font-weight: 600;
  color: #999999;
  padding: 6px;
  border-bottom: 1px solid #c7c7c7;
}
.github-Accordion-header::-webkit-details-marker {
  color: #999999;
}
.github-Accordion-content {
  border-bottom: 1px solid #c7c7c7;
  background-color: #ebebeb;
}
.github-Accordion-content:empty::before {
  content: "Empty";
  display: block;
  font-style: italic;
  text-align: center;
  color: #999999;
}
.github-Accordion-list {
  margin: 0;
  padding: 0;
  list-style: none;
}
.github-Accordion[open] .github-Accordion-header {
  color: #000000;
}
.github-Accordion-listItem {
  display: flex;
  align-items: center;
  padding: 3px;
  border-bottom: 1px solid #c7c7c7;
}
.github-Accordion-listItem:last-child {
  border: none;
}
.github-Accordion-listItem:active {
  background-color: #d9d9d9;
}
